PHP How to add entire array into MongoDB document field<p>I'm using a <code>php</code> page to insert new documents in my MongoDB database. I want to add an array of authors into a document field (<code>authors:['Sally Sue', 'Billy Bob']</code>) through a URI.</p>

<p>Here's my php page contents:</p>

<pre><code>&lt;?php
require __DIR__ . '/vendor/autoload.php'; // Composer autoloader

use MongoDB\Driver\Manager as Mongo;

// Set $_GET variables
if (isset($_GET['authors'])){
    $authors = explode(',', filter_var($_GET['authors'], FILTER_SANITIZE_STRING));
} else {
    $authors = 'N/A';
}

$mongo = new Mongo("mongodb://127.0.0.1:27017/myDB");
$db = new MongoDB\Database($mongo, "myDB");    
$collection = $db-&gt;selectCollection("articles");
$result = $collection-&gt;insertOne([
    'authors' =&gt; $authors,
]);

print_r($result);

?&gt;
</code></pre>

<p><strong>URI string</strong>:</p>

<pre><code>http://x.x.x.x/mySite/insertArticle.php?authors=Sally%20Sue,%20Billy%20Bob
</code></pre>

<p>However, the code is inserting my <code>$authors</code> variable as a string:</p>

<pre><code>Notice: Array to string conversion in /var/www/html/mySite/insertArticle.php on line 17
</code></pre>

<p>How can I insert the <code>$authors</code> variable as an array? Do I have to use a <code>for</code> loop or is there a way to insert the entire array contents all at once as one variable?</p>

