Embed Field: How do I index a field on a mongoose Schema that uses a discriminator?<p>The error started after I started using the discriminator.</p>

<pre><code>const mongoose = require("mongoose");
const Schema = mongoose.Schema;

const Base = require("../config/Base");

const Refill = Base.discriminator(
  "Refill",
  new Schema({
    cylinderSize: { type: Number, required: true },
    cylinderSwap: { type: Boolean, required: true },
    quantity: { type: Number, required: true },
    location: {
      type: { type: String },
      coordinates: [Number]
    }
  })
);

Refill.index({ location: "2dsphere" });


module.exports = mongoose.model("Refill");
</code></pre>

<p>This returns the error <code>Refill.index is not a function</code></p>; Answer: Can you please add what CMake version and which build environment you are using/targeting? Generally speaking, adding non-source files to `add_library()` is for listing those files in generated IDE projects. It does not add a dependency to this file. I think what you are looking for is the target property [`LINK_DEPENDS`](https://cmake.org/cmake/help/v3.3/prop_tgt/LINK_DEPENDS.html): "Specifies a semicolon-separated list of full-paths to files on which the link rule for this target depends. The target binary will be linked if any of the named files is newer than it."

